     //dark mode toggle
      <div className="toggle-container">
        <input type="checkbox" id="switch" name="theme" />
        <label htmlFor="switch">Toggle</label>
      </div>
      //dark mode toggle
      
        <Link to="/" className="logo">Blog</Link>
        <nav>
        <Link to="/login">Login</Link>
        
        <Link to="/register">Register</Link>
          
        </nav>
    </header>
      
  )
}
